import React from 'react';

const AdminDashboard = ({ stats }) => {
  // Requirements ke hisaab se calculations
  const totalMeetings = stats.filter(s => s.type.includes('Meeting')).length;
  
  // Sabhi officers ki total distance ka sum
  const totalDistance = stats.reduce((acc, s) => acc + (Number(s.distanceToday) || 0), 0);
  
  const b2bSales = stats.filter(s => 
    s.type === 'Sale' && s.payload?.mode?.toUpperCase() === 'B2B'
  ).length;

  const b2cSales = stats.filter(s => 
    s.type === 'Sale' && s.payload?.mode?.toUpperCase() === 'B2C'
  ).length;

  return (
    <div style={dashStyles.wrapper}>
      <h2 style={{color: '#2c3e50'}}>üõ∞Ô∏è Occamy Central Control</h2>
      
      <div style={dashStyles.grid}>
        <div style={dashStyles.card}><h4>Total Distance (All)</h4><p>{totalDistance} km</p></div>
        <div style={dashStyles.card}><h4>Meetings</h4><p>{totalMeetings}</p></div>
        <div style={dashStyles.card}><h4>B2B Sales</h4><p>{b2bSales}</p></div>
        <div style={dashStyles.card}><h4>B2C Sales</h4><p>{b2cSales}</p></div>
      </div>

      <div style={dashStyles.tableBox}>
        <h3>Ground Activity Log (Verifiable Data)</h3>
        <table style={dashStyles.table}>
          <thead>
            <tr style={{background: '#ecf0f1'}}>
              <th style={dashStyles.th}>Date</th> {/* Naya Date Column */}
              <th style={dashStyles.th}>Officer</th>
              <th style={dashStyles.th}>Type</th>
              <th style={dashStyles.th}>Distance (Entry)</th> {/* Naya Distance Column */}
              <th style={dashStyles.th}>Village</th>
              <th style={dashStyles.th}>GPS Location</th>
              <th style={dashStyles.th}>Proof</th>
            </tr>
          </thead>
          <tbody>
            {stats.map(s => (
              <tr key={s.id} style={{borderBottom: '1px solid #eee'}}>
                <td style={dashStyles.td}>{s.date || new Date().toLocaleDateString()}</td> {/* Date display */}
                <td style={dashStyles.td}>{s.officer}</td>
                <td style={dashStyles.td}><strong>{s.type}</strong></td>
                <td style={dashStyles.td}>{s.distanceToday ? `${s.distanceToday} km` : '-'}</td> {/* Individual distance */}
                <td style={dashStyles.td}>{s.village || 'N/A'}</td>
                <td style={dashStyles.td}>
                  {s.location ? `${s.location.lat.toFixed(4)}, ${s.location.lng.toFixed(4)}` : 'N/A'}
                </td>
                <td style={dashStyles.td}>
                  {s.photo && <a href={`http://localhost:5000${s.photo}`} target="_blank" rel="noreferrer" style={{color: '#3498db'}}>View Proof</a>}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const dashStyles = {
  wrapper: { padding: '20px', backgroundColor: '#f4f7f6', minHeight: '100vh' },
  grid: { display: 'flex', gap: '15px', marginBottom: '25px' },
  card: { flex: 1, padding: '20px', background: '#fff', borderRadius: '12px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)', textAlign: 'center' },
  tableBox: { background: '#fff', padding: '20px', borderRadius: '12px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)', overflowX: 'auto' },
  table: { width: '100%', borderCollapse: 'collapse' },
  th: { padding: '12px', textAlign: 'left', borderBottom: '2px solid #ddd' },
  td: { padding: '12px' }
};

export default AdminDashboard;
